  input: TEXT,F3XA,,"Line 17 receipts include several transactions from media organizations.
    These were all for rental of media facilities for the 11/15/03 Jefferson-Jackson
    Dinner or for the 1/19/04 Iowa caucuses. For the six months ended 12/31/03, we
    had no staff whose hours met the 25% threshold for reporting as FEA on line 30(b).
    Accordingly, payroll and benefits have been reported as allocable expenditures
    on line 21(a). All of the committee's administrative expenses, as defined in the
    Act, have been allocated using the applicable allocation percentage. Line 22 reports
    $229,000 in transfers to our non-federal account, all for cash flow. None of these
    transfered funds were expended in connection with any federal election or candidate."
